import React from 'react';
import events from 'backend/data.js'; 

const EventsPage = () => {
  return (
    <div>
      {events.map(event => (
        <div key={event.id}>
          <h3>{event.title}</h3>
          <p>{event.startDate} - {event.endDate}</p>
          <button>{event.buttonLabel}</button>
        </div>
      ))}
    </div>
  );
};

export default EventsPage;
